package lap4;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num=20;
		switch(num){
			case 5 : System.out.println("It is 5");
			
			case 20 : System.out.println("It is 20 ");
			
			default : System.out.println("not present ");
		}

	}

}
